<script>
export default {
	mounted() {
		// init controller
		let controller = new ScrollMagic.Controller();
		this.controller = controller;
		let $word = document.querySelector("#word");
		// let $dot = document.querySelector("#dot");

		const lineLength1 = $word.getTotalLength();
		$word.style.strokeDasharray = lineLength1;
		$word.style.strokeDashoffset = lineLength1;
		// const lineLength2 = $dot.getTotalLength();
		// $dot.style.strokeDasharray = lineLength2;
		// $dot.style.strokeDashoffset = lineLength2;
		// build tween
		let tween = new TimelineMax()
			.add(
				TweenMax.to($word, 0.9, {
					strokeDashoffset: 0,
					ease: Linear.easeNone
				})
			) // draw word for 0.9
