			// 	})
			// ) // draw dot for 0.1
			.add(
				TweenMax.to("path", 1, {
					stroke: "#33629c",
					ease: Linear.easeNone
				}),
				0
			); // change color during the whole thing

		// build scene
		let scene = new ScrollMagic.Scene({
			triggerElement: ".demo",
			duration: 200,
			tweenChanges: true
		})
			.setTween(tween)
			.addIndicators() // add indicators (requires plugin)
			.addTo(controller);
	},
	destroyed(){
		this.controller.destroy();
	}
};
